syntax = "proto3";

package bokura;

import "table_basic.proto";

message SeasonNodeDataTableBase {
    int32 Id = 1463;
    int32 NodeId = 1205;
    int32 NodeLevel = 1559;
    mlstring NodeName = 830;
    string NodeIcon = 1736;
    int_table NodeEffect = 1425;
    string_table BuffValueKey = 668;
    int_table BuffPar = 1688;
}
message SeasonNodeDataTableMgr {
    repeated bokura.SeasonNodeDataTableMgr.DatasEntry datas = 1;
}
